import imgJM from './Images/JoeMansueto.jpg';
import imgMZ from './Images/MarkZuckerberg.jpg';


var business1 = {
  image1: imgMB,
  image2: imgWB,
  image3: imgKG,

  name1: "Michael Burry",
  name2: "Warren Bufett",
  name3: "Kenneth Griffin",
}

var business2 = {
  image1: imgJB,
  image2: imgJM,
  image3: imgMZ,

  name1: "Jeffrey Bezos",
  name2: "Joe Mansueto",
  name3: "Mark Zuckerberg",
}
*/
function App() {
  return (
    <div>
    <Router>
      <div>
        <Switch>
          <Route path="/Business">
            <BusinessPage />
          </Route>
          <Route path="/Sports">

          </Route>
          <Route path = "/Politics">

          </Route>
          <Route path = "/HealthyLiving">

          </Route>
        </Switch>
      </div>
      </Router>

    </div>
  )
}
